import LeagueSelection from "./SelectLeague";

export default function Home({
    inputUsername,
    handleUsernameChange,
    handleConfirmUser,
    username,
    leagues,
    handleLeagueChange,
    handleLeagueConfirm,
    confirmedLeague,
    handleShowRosters,
    handleLeagueButton,
  }) {
    return (
      <div className="home">
        {username ? (
          <>
            <h2>Welcome, {username}</h2>
            <LeagueSelection
              leagues={leagues}
              handleLeagueChange={handleLeagueChange}
              handleLeagueConfirm={handleLeagueConfirm}
              confirmedLeague={confirmedLeague}
              handleShowRosters={handleShowRosters}
              handleLeagueButton={handleLeagueButton}
            />
          </>
        ) : (
          <>
            <h2>Welcome</h2>
            <div className="input-group">
              <input
                type="text"
                value={inputUsername}
                onChange={handleUsernameChange}
                className="username-input"
                placeholder="username"
              />
              <button onClick={handleConfirmUser}>Confirm</button>
            </div>
          </>
        )}
      </div>
    );
  }
